    const fullUrl = `${process.env.ALPACA_PAPER_URL}&${start}&${end}}` + symbols;

    fetch(process.env.ALPACA_BASE_URL, options)
        .then(response => response.json())
        .then(response => console.log(response))
        .catch(err => console.error(err));
