const log4js = require('log4js');
const jsonLayout = require('log4js-json-layout').layout;

let _logger = null;

function initialize() {
    log4js.addLayout('json', jsonLayout);
    log4js.configure({
        appenders: {
            assist: {
                type: "fileSync",
                filename: "assist.log",
                maxLogSize: 10458760,
                backups: 3,
                layout: {
                    type: 'pattern',
                    pattern: '%d{yyyy-MM-dd hh:mm:ss} [%p] %c - (%f{2}:%l) %m %n',
                }
            },
            out: {
                type: "stdout"
            },
            layout: {
                type: 'json'
            }
        },
        assist_console: {
            type: "out"
        },
        categories: {
            default: {
                appenders: ['assist', 'out'],
                level: 'debug'
            }
        },
    }); 
    _logger = log4js;
}

function logger() {
    if (!_logger) {
        initialize();
        return _logger.getLogger();
    }

    return _logger;
}

module.exports = logger;

const config = require('dotenv').config();
const openAiClient = require('./client/openAiClient')

async function getEmbedding(text) {
	console.log('embedding vectors: ', text);

	const textEmbeddingVector= {
		model: config.parsed.EMBEDDING_MODEL,
		input: text
	};

	try {
		if (openAiClient) {
			const embedding = await openAiClient.embeddings.get(textEmbeddingVector);
			console.log(embedding)
			return embedding;
		} else {
			return {
				Message: `Not Initialized for model ${config.parsed.EMBEDDING_MODEL}`
			}
		}
	} catch(err) {
		console.log("failed to get embedding with error: ", err);
		return err;
	}
}

async function addEmbedding(embeddingText) {
	console.log('text to embed', embeddingText)

	const embed= {
		model: config.parsed.EMBEDDING_MODEL,
		input: embeddingText
	};

	try {
		const embedding = await openAiClient.embeddings.create(embed);
		console.log(embedding);
		return embedding;
	} catch(err) {
		console.log("failed to embed with error: ", err);
		return err;
	}
}

module.exports = {addEmbedding, getEmbedding};
